import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';

//scrollspy
import Scrollspy from 'react-scrollspy'

//
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import purple from '@material-ui/core/colors/purple';
import Button from '@material-ui/core/Button';

const theme = createMuiTheme({
  palette: {
    primary: { main: purple[500] }, // Purple and green play nicely together.
    secondary: { main: '#11cb5f' }, // This is just green.A700 as hex.
  },
  typography: { useNextVariants: true },
});
//

const styles = theme => ({
  root: {
    top: 78,
    position: 'sticky',
  },
});

/*const styles = {
  appBar: {
    top: 78,
    position: 'fixed',
    zIndex: 1,
    width: '100%',
  },
};*/

function MonthBar(props) {
  const { classes } = props;

  return (
    
      <Paper className={classes.root}>
        <div>
          <MuiThemeProvider theme={theme}>
            <div>
              <Scrollspy style={{paddingLeft: 1}} items={['section-1', 'section-2', 'section-3', 'section-4', 'section-5', 'section-6','section-7', 'section-8', 'section-9', 'section-10', 'section-11', 'section-12']} currentClassName="is-current" componentTag="div">                
                <a href="#section-1">jan</a>
                <a href="#section-2">feb</a>
                <a href="#section-3">mrt</a>
                <a href="#section-4">apr</a>
                <a href="#section-5">mei</a>
                <a href="#section-6">jun</a>
                <a href="#section-7">jul</a>
                <a href="#section-8">aug</a>
                <a href="#section-9">sep</a>
                <a href="#section-10">okt</a>
                <a href="#section-11">nov</a>
                <a href="#section-12">dec</a>
              </Scrollspy>
            </div>
          </MuiThemeProvider>
        </div>
      </Paper>
    
  );
}

MonthBar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(MonthBar);
